import React from 'react';
import './Admin.css';

const Admin = () => {
  return (
    <div className="admin-container">
      <h2 className="admin-title">Admin Page</h2>
      <div className="admin-profiles">
        <div className="profile-card">
          <div className="profile-img"></div>
          <p className="profile-name">Anjali Sharma</p>
          <p className="profile-college">ABC University</p>
        </div>
        <div className="profile-card">
          <div className="profile-img"></div>
          <p className="profile-name">Ravi Kumar</p>
          <p className="profile-college">XYZ Institute of Technology</p>
        </div>
      </div>
    </div>
  );
};

export default Admin;
